  return (
    <Layout>
    	<div>
      		<AboutHead />
      		<AboutContent1 />
      		<AboutContent2 />

      <style jsx>{`
      	div {
      		text-align: center;
      		height: 1900px;
			background: url('https://www.finance-monthly.com/Finance-Monthly/wp-content/uploads/2019/11/Crypto-750x400.jpg') no-repeat center center; 
			-webkit-background-size: cover;
			-moz-background-size: cover;
			-o-background-size: cover;
			background-size: cover;   
      	}



      `}</style>
    	</div>
    </Layout>
  );
}
